import { useEffect, useState } from "react";
import axios from "axios";
import ItemListado from "./ItemListado";

export default function Productos() {
  const [mercaderia, setMercaderia] = useState([]);
  let traerProductos = async () => {
    const res = await axios.get(
      "https://fakerapi.it/api/v1/products?_quantity=20&_taxes=12&_categories_type=uuid"
    );
    setMercaderia(res.data.data);
    console.log(res.data.data);
  };
  useEffect(() => {
    traerProductos();
  }, []);
  return (
    <div>
      <h1>Somos los productos</h1>
      {mercaderia.map((item) => (
        <ItemListado {...item}></ItemListado>
      ))}
    </div>
  );
}
